import React from "react";
import "./style.css";
import { NavLink} from "react-router-dom";

const Manu = () => {
  const isActive = {
    fontWeight: "bold",
    backgroundColor: "red",
  };
  return (
    <>
      <div class="rc_nav" id="centered_nav">
        <h1 className="title">Sayaib Sarkar</h1>
        <NavLink className="nav-link" to="/Shop" activeStyle={isActive}>
                Shop
              </NavLink>
        <a href="#services" activeStyle={isActive} title="Services">
          Services
        </a>
        <a href="#about" activeStyle={isActive} title="About">
          About
        </a>
        <a href="#contact" activeStyle={isActive}  title="Contact">
          Contact
        </a>
      </div>
    </>
  );
};

export default Manu;
